8\u0442\u0435\u0442\">\u0413\u0438\u0441\u0441\u0435\u043d\u0441\u043a\u043e\u043c \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0441\u0442\u0435\u043f\u0435\u043d\u044c \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 13-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%82%D1%82%D0%B5,_%D0%9A%D0%B0%D1%80%D0%BB\" title=\"\u0412\u0438\u0442\u0442\u0435, \u041a\u0430\u0440\u043b\">\u041a\u0430\u0440\u043b \u0412\u0438\u0442\u0442\u0435<\/a>, \u0441\u0442\u0430\u0432\u0448\u0438\u0439 (\u0438 \u0434\u043e \u0441\u0438\u0445 \u043f\u043e\u0440 \u044f\u0432\u043b\u044f\u044e\u0449\u0438\u0439\u0441\u044f) \u0441\u0430\u043c\u044b\u043c \u044e\u043d\u044b\u043c \u0434\u043e\u043a\u0442\u043e\u0440\u043e\u043c \u043d\u0430\u0443\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1829_%D0%B3%D0%BE%D0%B4\" title=\"1829 \u0433\u043e\u0434\">1829<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D0%BB%D0%BB%D1%8C_%D0%BE%D0%B1_%D1%8D%D0%BC%D0%B0%D0%BD%D1%81%D0%B8%D0%BF%D0%B0%D1%86%D0%B8%D0%B8_%D0%BA%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%BA%D0%BE%D0%B2\" title=\"\u0411\u0438\u043b\u043b\u044c \u043e\u0431 \u044d\u043c\u0430\u043d\u0441\u0438\u043f\u0430\u0446\u0438\u0438 \u043a\u0430\u0442\u043e\u043b\u0438\u043a\u043e\u0432\">\u0410\u043a\u0442\u0430 \u043e\u0431 \u044d\u043c\u0430\u043d\u0441\u0438\u043f\u0430\u0446\u0438\u0438<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u0432\u0435\u0440\u043e\u0438\u0441\u043f\u043e\u0432\u0435\u0434\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D0%B8%D0%B7%D0%BC\" title=\"\u041a\u0430\u0442\u043e\u043b\u0438\u0446\u0438\u0437\u043c\">\u043a\u0430\u0442\u043e\u043b\u0438\u043a\u0430\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 \u041e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u0435 \u0440\u0430\u0431\u043e\u0442 \u043f\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u043f\u0435\u0440\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" title=\"\u041f\u043e\u043b\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u041f\u043e\u043b\u043d\u043e\u0433\u043e \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u044f \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%B